import React, {useState} from "react";
import "./navbar.css";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <>
      <nav className="navbar">
        <div className="navbar-container">
          <Link to="/" className="navbar-logo">
          </Link>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
